body {
  --blue200: #90c2ff;
  --blue300: #64a8ff;
  --Grey500: #8b95a1;
  --Grey700: #4e5968;
  --Grey800: #333d4b;
  --adaptiveOpacity300: rgba(0, 29, 58, 0.18);
  --adaptiveOpacity50: rgba(0, 23, 51, 0.05);
}

#navbar {
  border-bottom: 0.5px solid var(--Grey500);
  position: fixed;
  z-index: 50;
  width: 100%;
  height: 60px;
  background-color: #fff;
  left: 0;
  transition: background-color 0.2s ease;

  .nav-container {
    width: 100%;
    height: 100%;
    display: flex;
    justify-content: center;
    align-items: center;

    .nav-inner {
      width: 92%;
      height: 100%;
      display: flex;
      justify-content: space-between;
      align-items: center;
      a {
        text-decoration: none;
        color: var(--Grey800);
      }
      .logo {
        font-family: "Pacifico", sans-serif;
        margin: 0 30px;
        cursor: pointer;
      }

      .main-nav {
        margin: 0px 30px;
        .nav-menu {
          display: flex;
          align-items: center;
          padding: 0;
          margin: 0;
          .nav-item {
            list-style: none;

            a {
              margin: 0 10px;
              color: var(--Grey700);
              padding: 12px 10px;
              font-size: 15px;
              line-height: 20px;
              color: currentColor;
              border-radius: 8px;
              border: 0;
              cursor: pointer;
            }
          }
          .nav-item :hover {
            background-color: var(--adaptiveOpacity50);
          }
        }
      }
    }
  }
}

.progress-container {
  width: 100%;
  height: 2px;
  background: transparent;
  .progress-bar {
    width: 0;
    height: 2px;
    background: linear-gradient(
      90deg,
      red,
      orange,
      yellow,
      green,
      blue,
      navy,
      purple
    );
  }
}

.content-container {
  // border: 1px solid black;
  width: 100%;
  max-width: 750px;
  height: 80%;
  margin: 0 auto;
  padding-top: 60px;
  overflow-wrap: break-word;

  .create-content {
    margin-top: 60px;
    display: flex;
    justify-content: center;
    align-items: center;
    flex-direction: column;
    .btn {
      width: 80%;
      height: 70px;
      background-color: white;
      border-radius: 10px;
    }
    .create-post {
      font-size: 32px;
      cursor: pointer;
    }
  }
  .card-container {
    padding: 60px 40px;
    height: 80%;
    display: flex;
    justify-content: flex-start;
    flex-direction: column;

    // border: 1px solid pink;
    .content-box {
      align-items: flex-start;
      display: flex;
      flex-direction: column;
      justify-content: flex-start;
      width: 100%;
      cursor: pointer;
      .content-img {
        inset: 0px;
        box-sizing: border-box;
        padding: 0px;
        border: none;
        margin: auto;
        display: block;
        min-width: 100%;
        max-width: 100%;
        min-height: 100%;
        max-height: 100%;
        object-fit: cover;
        border-radius: 15px;
        margin-bottom: 30px;
        transition: 0.5s all;
      }
      span {
        font-size: 15px;
        color: var(--Grey500);
        margin-bottom: 10px;
        font-size: 15px;
        font-weight: 400;
        line-height: 1.4;
      }
      h4 {
        @media screen and (max-width: 560px) {
          font-size: 26px;
        }
        @media screen and (max-width: 525px) {
          font-size: 20px;
        }
        color: var(--Grey800);
        font-size: 32px;
        margin-bottom: 10px;
        margin-bottom: 10px;
        font-weight: 600;
        line-height: 1.4;
        transition: 0.2s ease-in-out;
      }
      p {
        @media screen and (max-width: 525px) {
          font-size: 13px;
        }
        color: var(--Grey700);
        font-size: 16px;
        margin-bottom: 10px;
        font-weight: 300;
        line-height: 27px;
      }
      .time {
        color: var(--Grey500);
        font-size: 14px;
        line-height: 1.4;
        margin-bottom: 10px;
      }
    }
    .content-box:hover {
      .content-img {
        box-shadow: 0px 32px 94px -35px rgba(186, 184, 186, 1);
        transform: translateY(-20px);
      }
      h4 {
        color: var(--blue300);
      }
    }
  }
}

@media screen and (max-width: 560px) {
  h4 {
    font-size: 26px;
  }
}
